import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from "react-router-dom";

function DataEntryForm() {
    const [brojLovackeIskaznice, setBrojLovackeIskaznice] = useState('');
    const [sifraZivotinje, setSifraZivotinje] = useState('');
    const [vrijemeOdstrijela, setVrijemeOdstrijela] = useState('');
    const [datumOdstrijela, setDatumOdstrijela] = useState('');
    const [lokacijaOdstrijela, setLokacijaOdstrijela] = useState('');
    const [message, setMessage] = useState('');
    const navigate = useNavigate();

    const handleSubmit = (event) => {
        event.preventDefault();
        const culledAnimalData = {
            broj_lovacke_iskaznice: brojLovackeIskaznice,
            sifra_zivotinje: sifraZivotinje,
            vrijeme_odstrijela: vrijemeOdstrijela,
            datum_odstrijela: datumOdstrijela,
            lokacija_odstrijela: lokacijaOdstrijela
        };

        // Retrieve the token from local storage
        const token = localStorage.getItem('token');

        // Set up the configuration for the axios request including the Authorization header
        const config = {
            headers: {
                'Authorization': `Bearer ${token}`
            }
        };

        axios.post('http://localhost:3000/unos-ostrjelene-zivotinje', culledAnimalData, config)
            .then(response => {
                alert('Ostrjelena životinja je dodana.');
                navigate("/popis-ostrjelene-zivotinje");
            })
            .catch(error => {
                console.error('There was an error!', error);
                setMessage(`Error: ${error.message}`);
            });
    };

    // Styles
    const formStyle = {
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        justifyContent: 'center',
        margin: '50px',
        padding: '20px',
        borderRadius: '8px',
        boxShadow: '0 4px 8px rgba(0,0,0,0.1)',
        backgroundColor: '#f7f7f7'
    };

    const inputStyle = {
        margin: '10px 0',
        padding: '10px',
        width: '300px',
        borderRadius: '5px',
        border: '1px solid #ccc'
    };

    const buttonStyle = {
        padding: '10px 20px',
        fontSize: '16px',
        color: 'white',
        backgroundColor: '#007BFF',
        border: 'none',
        borderRadius: '5px',
        cursor: 'pointer'
    };

    const labelStyle = {
        margin: '10px 0',
        fontWeight: 'bold'
    };

    return (
        <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh', backgroundColor: '#eee' }}>
            <form onSubmit={handleSubmit} style={formStyle}>
                <h1 style={{ color: '#333' }}>Unos ostrjelene životinje</h1>
                <div>
                    <label style={labelStyle}>Broj lovačke iskaznice:</label>
                    <input
                        type="number"
                        value={brojLovackeIskaznice}
                        onChange={(e) => setBrojLovackeIskaznice(e.target.value)}
                        required
                        style={inputStyle}
                    />
                </div>
                <div>
                    <label style={labelStyle}>Šifra životinje:</label>
                    <input
                        type="number"
                        value={sifraZivotinje}
                        onChange={(e) => setSifraZivotinje(e.target.value)}
                        required
                        style={inputStyle}
                    />
                </div>
                <div>
                    <label style={labelStyle}>Vrijeme odstrijela:</label>
                    <input
                        type="time"
                        value={vrijemeOdstrijela}
                        onChange={(e) => setVrijemeOdstrijela(e.target.value)}
                        required
                        style={inputStyle}
                    />
                </div>
                <div>
                    <label style={labelStyle}>Datum odstrijela:</label>
                    <input
                        type="date"
                        value={datumOdstrijela}
                        onChange={(e) => setDatumOdstrijela(e.target.value)}
                        required
                        style={inputStyle}
                    />
                </div>
                <div>
                    <label style={labelStyle}>Lokacija odstrijela:</label>
                    <input
                        type="text"
                        value={lokacijaOdstrijela}
                        onChange={(e) => setLokacijaOdstrijela(e.target.value)}
                        required
                        style={inputStyle}
                    />
                </div>
                <button type="submit" style={buttonStyle}>Unesi</button>
                <br></br>
                <button onClick={() => navigate('/popis-ostrjelene-zivotinje')} style={buttonStyle}>
                    Odustani
                </button>
            </form>
            {message && <p>{message}</p>}
        </div>
    );
}

export default DataEntryForm;
